import React from "react";
import EventNoteIcon from '@material-ui/icons/EventNote';

const HeaderComp = ()=>{
    return(
        <div className="row" id="header">
            <h1 className="headerComp"><EventNoteIcon id="noteIcon"/> Google Keep </h1>
        </div>
    );
}

export default HeaderComp;
